    def addEmployee(self):
        salary = self.lineAddSalary.text()
        address = self.lineAddAddress.text()
        phone = self.lineAddPhoen.text()
        role = self.lineAddRole.text()
        last_name = self.lineAddLastName.text()
        first_name = self.lineAddFirstName.text()
        password = self.lineEdit.text()
        if (salary != "") & (address != "") & (phone != "") & (role != "") & (last_name != "") & (first_name != "") & (password!=""):
            salary = int(salary)
            cursor.execute(sql_queries.select_job_id, (role,))
            roleId = cursor.fetchone()
            if roleId:
                roleId = roleId[0]
                if ((len(address) > 10) & (len(password)>7) &(len(phone) > 10) & (len(first_name) > 2) & (
                    len(last_name) > 2) & (
                    salary > 1500) & (salary < 15000)):
                    hire_date = datetime.datetime.now().strftime("%Y-%m-%d")
                    cursor.execute(sql_queries.insert_employee,
                                   (first_name, last_name, hire_date, roleId, salary, phone, address))
                    connection.commit()
                    cursor.execute(sql_queries.insert_account, (password,))
                    connection.commit()
                    self.lineAddSalary.clear()
                    self.lineAddAddress.clear()
                    self.lineAddPhoen.clear()
                    self.lineAddRole.clear()
                    self.lineAddLastName.clear()
                    self.lineAddFirstName.clear()
                    self.lineEdit.clear()

                    cursor.execute(sql_queries.select_max_account_id)
                    id = cursor.fetchone()[0]

                    msg = QMessageBox()
                    msg.setText(f"ID : {id}\nPassword : {password}")
                    msg.setIcon(QMessageBox.Information)
                    msg.setStandardButtons(QMessageBox.Ok)
                    msg.setWindowTitle("Account Info")
                    msg.exec_()
                    self.lblInfoAdd.setText("Employee Added.")
                else:
                    self.lblInfoAdd.setText(
                            "Requirements Lengths: Password > 7, First Name > 2, Last Name > 2, 1500<salary<15000, Phone > 10, Address > 10")
            else:
                self.lblInfoAdd.setText(
                    "Role must be : AccessAdmin-Admin-DataWriter-DataReader-Saler-SalerManager!")
        else:
            self.lblInfoAdd.setText("Empty lines!!")

    def clear(self):
        self.tableEmployee.setRowCount(0)
        self.lblInfo.setText("")

    def updateEmployee(self):
        id = self.lineUpdateId.text()
        employee = Select.select_employee(id)
        if employee:
            first_name = self.lineUpdateFirstName.text() or employee.first_name
            last_name = self.lineUpdateLastName.text() or employee.last_name
            phone = self.lineUpdatePhone.text() or employee.phone
            salary = self.lineUpdateSalary.text() or employee.salary
            if employee.salary + 500 < int(salary):
                    salary = employee.salary + 500
            elif employee.salary - 500 > int(salary):
                    salary = employee.salary - 500
            address = self.lineUpdateAddress.text() or employee.address
            cursor.execute(sql_queries.update_employee, (first_name, last_name, salary, phone, address, id))
            connection.commit()
            self.lineUpdateId.clear()
            self.lineUpdateFirstName.clear()
            self.lineUpdateLastName.clear()
            self.lineUpdatePhone.clear()
            self.lineUpdateSalary.clear()
            self.lineUpdateAddress.clear()

    def deleteEmployee(self):
        id = self.lineDeleteEmployeeId.text()
        employee = Select.select_employee(id)
        if employee:
            cursor.execute(sql_queries.delete_employee, (id,))
            connection.commit()
            cursor.execute(sql_queries.delete_account, (id,))
            connection.commit()
        self.lineDeleteEmployeeId.clear()

